-- 테이블 unicorn.wise_files 구조 내보내기
DROP TABLE IF EXISTS `wise_files`;
CREATE TABLE IF NOT EXISTS `wise_files` (
  `file_seq` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '파일 일련번호',
  `file_id` varchar(45) NOT NULL COMMENT '파일 아이디(UUID)',
  `file_name1` varchar(255) DEFAULT NULL COMMENT '원본파일 이름',
  `file_name2` varchar(255) DEFAULT NULL COMMENT '변경파일 이름',
  `file_path` varchar(255) DEFAULT NULL COMMENT '파일 저장경로',
  `file_type` varchar(100) DEFAULT NULL COMMENT '파일종류',
  `file_size` int(10) unsigned DEFAULT NULL COMMENT '파일크기',
  `file_hit_count` mediumint(8) unsigned DEFAULT '0' COMMENT '파일 다운로드 회수',
  `file_revision` mediumint(8) unsigned DEFAULT NULL COMMENT '파일 리비젼 정보',
  `poster_id` varchar(15) DEFAULT NULL COMMENT '파일 등록자 ID',
  `post_time` datetime DEFAULT NULL COMMENT '파일 등록일시',
  PRIMARY KEY (`file_seq`),
  UNIQUE KEY `ix_file_seq_id_uk` (`file_id`,`file_seq`,`file_revision`)
) ENGINE=InnoDB AUTO_INCREMENT=15181 DEFAULT CHARSET=utf8 COMMENT='첨부파일 관리';

